script: |
  super -f text -I q3326.spq | sort > q3326.out

inputs:
  - name: q3326.spq
    data: |
      SELECT - col2 / + col1 * + 65 + + + col2 + CAST ( + + col0 AS REAL ) + col1 * 13 * col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE ( NULL ) IS NOT NULL;
  - name: tab2

outputs:
  - name: q3326.out
    data: |
